- Name: azure-security-keyvault-administration
  Version: 4.3.0-beta.1
  DisplayName: Key Vault - Administration
  ServiceName: Key Vault
  VersionType: Beta
  Hidden: false
  ChangelogUrl: https://github.com/Azure/azure-sdk-for-java/tree/azure-security-keyvault-administration_4.3.0-beta.1/sdk/keyvault/azure-security-keyvault-administration/CHANGELOG.md
  ChangelogContent: |-
    #### Features Added
    - Added `KeyVaultSettingsClient` and `KeyVaultSettingsAsyncClient` to get and update Managed HSM settings.
    - Added support for service version `7.4-preview.1`.
  GroupId: com.azure
- Name: azure-security-keyvault-keys
  Version: 4.6.0-beta.1
  DisplayName: Key Vault - Keys
  ServiceName: Key Vault
  VersionType: Beta
  Hidden: false
  ChangelogUrl: https://github.com/Azure/azure-sdk-for-java/tree/azure-security-keyvault-keys_4.6.0-beta.1/sdk/keyvault/azure-security-keyvault-keys/CHANGELOG.md
  ChangelogContent: |-
    #### Features Added
    - Added `CreateOkpKeyOptions` to pass key options when creating an Octet Key Pair (OKP) on Managed HSM.
    - Added `createOkpKey()` and `createOkpKeyWithResponse()` to `KeyClient` and `KeyAsyncClient` to create an Octet Key Pair (OKP) on Managed HSM.
    - Added `OKP` and `OKP_HSM` to `KeyType`.
    - Added `Ed25519` to `KeyCurveName` to create an Octet Key Pair (OKP) using the Ed25519 curve.
    - Added `EDDSA` to `SignatureAlgorithm` to support signing and verifying using an Edwards Curve Digital Signature Algorithm (EdDSA) on Managed HSM.
    - Added support for service version `7.4-preview.1`.
  GroupId: com.azure

